import { useContext } from 'react'
import { UserContext } from '../contexts/userContext'
import '../styles/tailwind.css'
import SideNav from '../components/SideNav'
import CenterPane from '../components/CenterPane'
export default () => {
    const { userID, storeUserID } = useContext(UserContext)
    const gridArray = ['grid grid-cols-mobileHome sm:grid-cols-home grid-rows-1 h-screen overflow-y-hidden', 'grid grid-cols-profile sm:grid-cols-home grid-rows-1 h-screen overflow-y-hidden']
    return(
        <div className="grid grid-cols-mobileHome sm:grid-cols-home grid-rows-1 h-screen overflow-y-hidden">
            <SideNav />
            <CenterPane />
        </div>
    )
}
